"use strict";(self.webpackChunkdsa=self.webpackChunkdsa||[]).push([[4980],{9177:e=>{e.exports=JSON.parse('{"label":"intro","permalink":"/dsa/docs/tags/intro","allTagsPath":"/dsa/docs/tags","count":1,"items":[{"id":"big-o/a-big-o-intro","title":"Introduction to Big O Notation","description":"\\"O\\" of \\"Big O\\" is from \u201corder,\u201d which is related to the rate of growth\u2014for example, of time or space. Big O complexity is an asymptotic property that describes the theoretical limits of time and space\u2014required to execute a program following a specific approach\u2014as the size of the input arguments tends to infinity. Time complexity is therefore a limiting behavior associated with the total runtime of a program. Likewise, space complexity is associated with the theoretical limit to space/memory required for its successful execution.","permalink":"/dsa/docs/big-o/a-big-o-intro"}]}')}}]);